import React, { useState, useEffect } from 'react';

function Predictions() {
  const [predictionOutput, setPredictionOutput] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const API_URL = 'http://localhost:3000'; // ✅ Match the backend port (5000, not 3001)

  useEffect(() => {
    fetchPredictions();
  }, []);

  const fetchPredictions = async () => {
    try {
      setLoading(true);
      setError(null); // ✅ Reset error on each attempt
      const response = await fetch(`${API_URL}/api/databricks-predictions`);
      if (!response.ok) throw new Error('Failed to fetch predictions');
      const data = await response.json();
      console.log('Databricks Output:', data.output);
      setPredictionOutput(data.output || 'No output returned from Databricks job');
    } catch (error) {
      console.error('Error:', error);
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="page-container">
      <h1>Databricks Predictions</h1>
      {error && <div className="error-message">Error: {error}</div>}
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div className="content-section">
          <pre style={{ whiteSpace: 'pre-wrap' }}>{predictionOutput}</pre>
        </div>
      )}
    </div>
  );
}

export default Predictions;
